syntax = "proto3";

package tinder.events.model.app.hubble.details;

import "google/protobuf/wrappers.proto";

option go_package = "github.com/TinderBackend/events.sdk/libraries/model/golang/model/app/hubble/details";
option java_multiple_files = true;
option java_package = "com.tinder.generated.events.model.app.hubble.details";

message PhotoSelectorPhotosCollectionDetails {
    google.protobuf.Int32Value total_number = 1;
    repeated google.protobuf.FloatValue rsrr_scores = 2;
    repeated google.protobuf.StringValue photo_ids = 3;
    repeated google.protobuf.FloatValue explicit_scores = 4;
    repeated google.protobuf.FloatValue text_scores = 5;
    repeated google.protobuf.FloatValue underage_scores = 6;
    repeated google.protobuf.FloatValue similarity_scores = 7;
}
